import React from "react";
const ButtonV1 = ({onClick,title}) => {
    return(
        <div className='Button-container Button-text-1'>
            <button className='buttonV1 tx-white bg-green ' onClick={onClick}>{title}</button>
        </div>
    );
};
const ButtonV2 = ({onClick,title}) => {
    return(
        <div className='Button-container Button-text-1'>
            <button className='buttonV2 tx-green' onClick={onClick}>{title}</button>
        </div>
    );
};
export {ButtonV1,ButtonV2};
